    <script>
      
      
document.addEventListener("DOMContentLoaded", () => {
  const preloader = document.querySelector("#preloader");
  window.addEventListener("load", () => {
    preloader.classList.add("preloaded");
    setTimeout(() => {
      preloader.remove();
    }, 1000);
  });
});

      
      window.onload = function () {
        var beforePan;

        beforePan = function (oldPan, newPan) {
          var stopHorizontal = false,
            stopVertical = false,
            gutterWidth = 100,
            gutterHeight = 100,
            // Computed variables
            sizes = this.getSizes(),
            leftLimit =
              -((sizes.viewBox.x + sizes.viewBox.width) * sizes.realZoom) +
              gutterWidth,
            rightLimit =
              sizes.width - gutterWidth - sizes.viewBox.x * sizes.realZoom,
            topLimit =
              -((sizes.viewBox.y + sizes.viewBox.height) * sizes.realZoom) +
              gutterHeight,
            bottomLimit =
              sizes.height - gutterHeight - sizes.viewBox.y * sizes.realZoom;

          customPan = {};
          customPan.x = Math.max(leftLimit, Math.min(rightLimit, newPan.x));
          customPan.y = Math.max(topLimit, Math.min(bottomLimit, newPan.y));

          return customPan;
        };

        window.zoom = svgPanZoom("#mapaCompleto", {
          zoomEnabled: true,
          panEnabled: true,
          controlIconsEnabled: true,
          mouseWheelZoomEnabled: false,
          dblClickZoomEnabled: false,
          preventMouseEventsDefault: true,
          zoomScaleSensitivity: 0.2,
          minZoom: 1,
          maxZoom: 5,
          beforePan: beforePan,
          // this option will make library to misbehave. Viewport should have no transform attribute
        });
      };
    </script>
